const Custos = ({ notas }) => {
  return (
    <div>
      {notas.map((nota) => (
        <div>
          <h3>{nota.corretora}</h3>
          <h3>{nota.data}</h3>
          <h3>{nota.folha}</h3>
          <h3>{nota["nr. nota"]}</h3>
          <h3>{nota.Custos.Total}</h3>
        </div>
      ))}
    </div>
  );
};

export default Custos;
